import Button from "../component/Button";
import Header from "../component/Header";

const Home = () => {
    return (
        <div>
            <Header
                title={"2023년 n월"}
                leftChild={<Button text={"<"}/>}
                rightChild={<Button text={">"}/>}
            />
        </div>
    );
};

export default Home;
